"use strict";
// Void
function somarValoresNumericos(numero1, numero2) {
    return numero1 + numero2;
}
console.log(somarValoresNumericos(5, 5));
/*console.log() não retorna nada para o usuário; utilize o tipo "void" = ausência do retorno
a função roda, mas não devolve nada para o usuário */
function printValoresNumericos(numero1, numero2) {
    console.log(numero1 + numero2);
}
